export default function Projects() {
  return (
    <ProjectPreview
      projectName="Quiz App"
      projectDescription="In our Recap Project Nr. 2 we had to code a little Quiz App and everytime we learned something new i added more functions and dynamic to my App."
      src=""
      alt="Quiz App Preview"
    />
  );
}

function ProjectPreview({
  projectImage,
  projectAlt,
  projectDescription,
  projectName,
}) {
  return;
  <div>
    <a href={projectLink}>
      <img src={projectImage} alt={projectAlt} />
      <h2>{projectName}</h2>
      <p>{projectDescription}</p>
    </a>
  </div>;
}
